import { post, get, _delete } from '@/lin/plugin/axios'

class Version {
  async getSysList() {
    const res = await get('/statistical/version/system')
    return res
  }

  async searchVersionList(data) {
    const res = await post('/statistical/version/list', data)
    return res
  }

  async createVersion(data) {
    const res = await post('/statistical/version/create', data)
    return res
  }

  async updateVersion(data) {
    const res = await post('/statistical/version/update', data)
    return res
  }

  async deleteVersion(id) {
    const res = await _delete(`/statistical/version/${id}`)
    return res
  }


  async queryVersionPercent(data) {
    const res = await post('/statistical/version/percent', data)
    return res
  }

  async queryVersionCount(data) {
    const res = await post('/statistical/version/count', data)
    return res
  }
}

export default new Version()
